function SearchBar(props) {
    return (
      <form class="d-flex flex-grow-1 ms-5 me-5">
        <input
          class="form-control me-2"
          type="search"
          placeholder="Search"
          aria-label="Search"
          w-75
        />
        <button class="btn btn-outline-success" type="submit">
          Search
        </button>
      </form>
    );
}

export default SearchBar;
